(1, 'terms', '<h2><strong>Terms and Conditions</strong></h2>\r\n\r\n    <p>Welcome to MyAce!</p>\r\n\r\n    <p>These terms and conditions outline the rules and regulations for the use of MyAce\'s Website, located at\r\n        myace.app.</p>\r\n\r\n    <p>By accessing this website we assume you accept these terms and conditions. Do not continue to use MyAce if you do\r\n        not agree to take all of the terms and conditions stated on this page.</p>\r\n\r\n    <p>The following terminology applies to these Terms and Conditions, Privacy Statement and Disclaimer Notice and all\r\n        Agreements: \"Client\", \"You\" and \"Your\" refers to you, the person log on this website and compliant to the\r\n        Companys terms and conditions. \"The Company\", \"Ourselves\", \"We\", \"Our\" and \"Us\", refers to our Company.\r\n        \"Party\", \"Parties\", or \"Us\", refers to both the Client and ourselves. All terms refer to the offer, acceptance\r\n        and consideration of payment necessary to undertake the process of our assistance to the Client in the most\r\n        appropriate manner for the express purpose of meeting the Clients needs in respect of provision of the\r\n        Companys stated services, in accordance with and subject to, prevailing law of Netherlands. Any use of the\r\n        above terminology or other words in the singular, plural, capitalization and/or he/she or they, are taken as\r\n        interchangeable and therefore as referring to same.</p>\r\n\r\n    <h3><strong>Cookies</strong></h3>\r\n\r\n    <p>We employ the use of cookies. By accessing MyAce, you agreed to use cookies in agreement with the MyAce\'s Privacy\r\n        Policy. </p>\r\n\r\n    <p>Most interactive websites use cookies to let us retrieve the users details for each visit. Cookies are used by\r\n        our website to enable the functionality of certain areas to make it easier for people visiting our website. Some\r\n        of our affiliate/advertising partners may als