censes and consents to do so;\r\n        </li>\r\n        <li>The Comments do not invade any intellectual property right, including without limitation copyright, patent\r\n            or trademark of any third party;</li>\r\n        <li>The Comments do not contain any defamatory, libelous, offensive, indecent or otherwise unlawful material\r\n            which is an invasion of privacy</li>\r\n        <li>The Comments will not be used to solicit or promote business or custom or present commercial activities or\r\n            unlawful activity.</li>\r\n    </ul>\r\n\r\n    <p>You hereby grant MyAce a non-exclusive license to use, reproduce, edit and authorize others to use, reproduce and\r\n        edit any of your Comments in any and all forms, formats or media.</p>\r\n\r\n    <h3><strong>Hyperlinking to our Content</strong></h3>\r\n\r\n    <p>The following organizations may link to our Website without prior written approval:</p>\r\n\r\n    <ul>\r\n        <li>Government agencies;</li>\r\n        <li>Search engines;</li>\r\n        <li>News organizations;</li>\r\n        <li>Online directory distributors may link to our Website in the same manner as they hyperlink to the Websites\r\n            of other listed businesses; and</li>\r\n        <li>System wide Accredited Businesses except soliciting non-profit organizations, charity shopping malls, and\r\n            charity fundraising groups which may not hyperlink to our Web site.</li>\r\n    </ul>\r\n\r\n    <p>These organizations may link to our home page, to publications or to other Website information so long as the\r\n        link: (a) is not in any way deceptive; (b) does not falsely imply sponsorship, endorsement or approval of the\r\n        linking party and its products and/or services; and (c) fits within the context of the linking partys site.</p>\r\n\r\n    <p>We may consider and approve other link requests from the following types of organizations:</p>\r\n\r\n    <ul>\r\n        <li>commonly-known consumer and/or business information sources;</li>\r\n        <li>dot.com community sites;</li>\r\n        <li>associations or other groups representing charities;</li>\r\n        <li>online directory distributors;</li>\r\n        <li>internet portals;</li>\r\n        <li>accounting, law and consulting firms; and</li>\r\n        <li>educational institutions and trade associations.</li>\r\n    </ul>\r\n\r\n    <p>We will approve link requests from these organizations if we decide that: (a) the link would not make us look\r\n        unfavorably to ourselves or to our accredited businesses; (b) the organization does not have any negative\r\n        records with us; (c) the benefit to us from the visibility of the hyperlink compensates the absence of MyAce;\r\n        and (d) the link is in the context of general resource information.</p>\r\n\r\n    <p>These organizations may link to our home page so long as the link: (a) is not in any way deceptive; (b) does not\r\n        falsely imply sponsorship, endorsement or approval of the linking party and its products or services; and (c)\r\n        fits within the context of the linking partys site.</p>\r\n\r\n    <p>If you are one of the organizations listed in paragraph 2 above and are interested in linking to our website, you\r\n        must inform us by sending an e-mail to MyAce. Please include your name, your organization name, contact\r\n        information as well as the URL of your site, a list of any URLs from which you intend to link to our Website,\r\n        and a list of the URLs on our site to which you would like to link. Wait 2-3 weeks for a response.</p>\r\n\r\n    <p>Approved organizations may hyperlink to our Website as follows:</p>\r\n\r\n    <ul>\r\n        <li>By use of our corporate name; or</li>\r\n        <li>By use of the uniform resource locator being linked to; or</li>\r\n        <li>By use of any other description of our Website being linked to that makes sense within the context and\r\n            format of content on the linking partys site.</li>\r\n    </ul>\r\n\r\n    <p>No use of MyAce\'s logo or other artwork will be allowed for linking absent a trademark license agreement.</p>\r\n\r\n    <h3><strong>iFrames</strong></h3>\r\n\r\n    <p>Without prior approval and written permission, you may not create frames around our Webpages that alter in any\r\n        way the visual presentation or appearance of our Website.</p>\r\n\r\n    <h3><strong>Content Liability</strong></h3>\r\n\r\n    <p>We shall not be hold responsible for any content that appears on your Website. You agree to protect and defend us\r\n        against all claims that is rising on your Website. No link(s) should appear on any Website that may be\r\n        interpreted as libelous, obscene or criminal, or which infringes, otherwise violates, or advocates the\r\n        infringement or other violation of, any third party rights.</p>\r\n\r\n    <h3><strong>Your Privacy</strong></h3>\r\n\r\n    <p>Please read Privacy Policy</p>\r\n\r\n    <h3><strong>Reservation of Rights</strong></h3>\r\n\r\n    <p>We reserve the right to request that you remove all links or any particular link to our Website. You approve to\r\n        immediately remove all links to our Website upon request. We also reserve the right to amen these terms and\r\n        conditions and its linking policy at any time. By continuously linking to our Website, you agree to be bound to\r\n        and follow these linking terms and conditions.</p>\r\n\r\n    <h3><strong>Removal of links from our website</strong></h3>\r\n\r\n    <p>If you find any link on our Website that is offensive for any reason, you are free to contact and inform us any\r\n        moment. We will consider requests to remove links but we are not obligated to or so or to respond to you\r\n        directly.</p>\r\n\r\n    <p>We do not ensure that the information on this website is correct, we do not warrant its completeness or accuracy;\r\n        nor do we promise to ensure that the website remains available or that the material on the website is kept up to\r\n        date.</p>\r\n\r\n    <h3><strong>Disclaimer</strong></h3>\r\n\r\n    <p>To the maximum extent permitted by applicable law, we exclude all representations, warranties and conditions\r\n        relating to our website and the use of this website. Nothing in this disclaimer will:</p>\r\n\r\n    <ul>\r\n        <li>limit or exclude our or your liability for death or personal injury;</li>\r\n        <li>limit or exclude our or your liability for fraud or fraudulent misrepresentation;</li>\r\n        <li>limit any of our or your liabilities in any way that is not permitted under applicable law; or</li>\r\n        <li>exclude any of our or your liabilities that may not be excluded under applicable law.</li>\r\n    </ul>\r\n\r\n    <p>The limitations and prohibitions of liability set in this Section and elsewhere in this disclaimer: (a) are\r\n        subject to the preceding paragraph; and (b) govern all liabilities arising under the disclaimer, including\r\n        liabilities arising in contract, in tort and for breach of statutory duty.</p>\r\n\r\n    <p>As long as the website and the information and services on the website are provided free of charge, we will not\r\n        be liable for any loss or damage of any nature.</p>', '2022-10-04 16:12:43', '2022-10-05 04:47:34');
INSERT INTO `appPages` (`id`, `page`, `content`, `createdAt`, `updatedAt`) VALUES
(2, 'policy', '<h2 class=\"text-center\">Privacy Policy</h2>\r\n    <div style=\"width: 100%; background-color: #ffffff; margin-top: -0px; \"\r\n        class=\"slds-col slds-is-relative slds-hyphenate slds-text-align_left slds-p-around_medium slds-container_center\"\r\n        data-aura-rendered-by=\"363:0\">\r\n        <p class=\"js-content-subtitle slds-m-top_small slds-text-body_regular\" data-aura-rendered-by=\"378:0\">\r\n            <lightning-formatted-rich-text class=\"js-content-subtitle slds-rich-text-editor__output\"\r\n                data-aura-rendered-by=\"379:0\"><span>\r\n                    <p>&nbsp;</p>\r\n                    <p style=\"text-align: justify;\">MyAce, Inc. and its group companies (collectively,\r\n                        MyAce, we, us, or our) are committed to protecting your privacy. This Privacy\r\n                        Policy (Policy) explains how we collect, use, disclose and protect Personal\r\n                        Information (as it is defined below) of our MyAce Drivers (Drivers) in their\r\n                        capacity as Drivers. It applies to all Personal information collected from such Drivers\r\n                        by us on the web pages for Drivers, and (the Site), the Driver mobile application, and\r\n                        any other website or mobile application\r\n                        that links to this Policy, as well as during any written, electronic, and oral\r\n                        communications (collectively, the \"Driver Services\").&nbsp;</p>\r\n                    <p style=\"text-align: justify;\">&nbsp;</p>\r\n                    <p style=\"text-align: justify;\">&nbsp;</p>\r\n                    <p style=\"text-align: justify;\">MyAce provides an online marketplace platform, using\r\n                        web-based technology that connects Drivers, consumers, and restaurants and/or other\r\n                        businesses utilizing the MyAce marketplace (Merchants). If you are using MyAces\r\n                        online marketplace in your capacity as a consumer accessing or ordering services, please\r\n                        visit the <a target=\"_blank\" href=\"https://MyAce.com/privacy-policy-user.html\"><u>Consumer\r\n                                Privacy Policy</u></a> for information on how MyAce collects and uses\r\n                        consumer Personal Information.</p>\r\n                    <p style=\"text-align: justify;\">&nbsp;</p>\r\n                    <p style=\"text-align: justify;\">The Driver Services may change from time to time. As a\r\n                        result, we reserve the right to update or modify this Policy at any time and from time\r\n                        to time without prior notice. If we make any material changes to the way we process your\r\n                        Personal Information, we will notify you before such changes are effective. If you\r\n                        object to any changes, you must cease using the Driver Services. We recommend you review\r\n                        this Policy periodically. This Policy became effective on the date indicated at the top\r\n                        of this page. Your continued use of the Driver Services after any changes or revisions\r\n                        to this Policy indicates your agreement to the terms of the revised Policy.</p>\r\n                    <p>&nbsp;</p>\r\n                    <p><b>1. Collection of Personal Information</b></p>\r\n                    <p>&nbsp;</p>\r\n                    <p>When you use the Driver Services, we may collect Personal Information about you. The\r\n                        types of Personal Information that we may collect about you are:</p>\r\n                    <p>&nbsp;</p>\r\n                    <p><i><u>1a. Information You Provide to Us Directly</u></i></p>\r\n                    <p>&nbsp;</p>\r\n                    <p>You may provide your personal information to us when you use the Driver Services,\r\n                        including when you sign up to become a Driver, authorize a background or driving history\r\n                        check, register as a Driver, participate as a Driver, participate in direct deposit,\r\n                        engage with our chat bot on the Site or Services, enroll in a MyAce assistance\r\n                        program, contact us with inquiries or otherwise communicate with us, or otherwise access\r\n                        or use the Driver Services. This information may include:</p>\r\n                    <p>&nbsp;</p>\r\n                    <ul>\r\n                        <li>Personal Identifiers and records information  We collect certain profile\r\n                            information associated with your Driver account. This may include information such\r\n                            as name, alias, postal address, email address, phone number, social security number,\r\n                            drivers license number, passport number, medical information, signature, or other\r\n                            similar identifiers.&nbsp;</li>\r\n                        <li>Age &amp; date of birth  We may collect your age, year or date of birth to enable\r\n                            us, for example, to assess whether you qualify to be a Driver and to determine if\r\n                            you are eligible to provide deliveries of alcohol.</li>\r\n                        <li>Biometric information  We may collect face photo, identity document, facial\r\n                            recognition, voice, or other biometric data.</li>\r\n                        <li>Commercial<i> Information</i>  We may collect driver and vehicle information, such\r\n                            as your drivers license number, license plate and other vehicle and registration\r\n                            information, and insurance information.</li>\r\n                        <li><i>Financial and Records Information</i>  We may collect financial information to,\r\n                            for example, facilitate payments to Drivers. This may include bank and bank account\r\n                            information, including routing and account numbers, and order payment information,\r\n                            including expense reimbursement requests.</li>\r\n                        <li>Preferences  We may also collect your preferences, such as language preference,\r\n                            preferred region and city, address, and preferences to receive texts instead of\r\n                            telephone calls.&nbsp;</li>\r\n                    </ul>\r\n                    <p><br></p>\r\n                    <p><i><u>1b. Information Received From You as Part of Your Communications</u></i></p>\r\n                    <p>&nbsp;</p>\r\n                    <p>When you use the Driver Services, complete electronic forms, communicate with MyAce\r\n                        customers or contact us, by online chat, email, phone or text, we may automatically\r\n                        collect and store certain information about you and the activity you engaged in, for\r\n                        example: your name and contact information; information that you voluntarily provide to\r\n                        us; the nature of your communication; the purpose of the interaction, and the action we\r\n                        took in response to your inquiry or request.</p>\r\n                    <p>&nbsp;</p>\r\n                    <p><i><u>1c. Information Collected Automatically</u></i></p>\r\n                    <p>&nbsp;</p>\r\n                    <p>We also may receive and store certain information about you and your device(s)\r\n                        automatically when you access or use our Site and the Driver Services. This information\r\n                        may include:</p>\r\n                    <p>&nbsp;</p>\r\n                    <ul>\r\n                        <li>Technical Information  We collect technical and internet or other network activity\r\n                            information associated with your activity on our Site and may include information\r\n                            related to your browser and operating system, IP address (the Internet address of\r\n                            your computer), unique device identifiers, personal and online identifiers, and\r\n                            other information such as your device type and version of the app that is in\r\n                            use.&nbsp;</li>\r\n                        <li>Site Usage Information  This may include the webpage that you were visiting before\r\n                            accessing our Site or mobile application, the pages or features of our Site or\r\n                            mobile application you browsed to inform us which part of our Site, app and Driver\r\n                            Services you visit and how much time you spend there, and your search history.&nbsp;\r\n                        </li>\r\n                        <li>Site Preferences  We collect information about your preferences to make your use of\r\n                            the Site more productive through the use of cookies.</li>\r\n                    </ul>\r\n                    <p>&nbsp;</p>\r\n                    <p><i><u>1d. Geolocation Information</u></i></p>\r\n                    <p>&nbsp;</p>\r\n                    <p>To participate as a Driver, you must permit the Driver Services to access location\r\n                        services through the permission system used by your mobile operating system (Platform)\r\n                        or browser. We may collect the precise location of your device when the Driver app is\r\n                        running in the foreground or background of your device or from a photo of a delivery\r\n                        that you provide to us. We may also collect route information when you conduct a\r\n                        delivery for MyAce and/or derive your approximate location from your IP address. We\r\n                        use your location information to verify that you are present in your preferred region or\r\n                        city when you begin or engage in a delivery through the MyAce Services (MyAce),\r\n                        connect you with delivery opportunities in your zone, and track the progress and\r\n                        completion of your Orders. You can enable the location tracking feature through the\r\n                        settings on your device or Platform or when prompted by the Driver mobile app. If you\r\n                        choose to disable the location feature through the settings on your device or Platform,\r\n                        MyAce will not receive precise location information from your device, which will\r\n                        prevent you from being able to receive delivery opportunities in your area.\r\n                    </p>\r\n                    <p><br></p>\r\n                    <p><i><u>1e. Information Related to Deliveries</u></i></p>\r\n                    <p>&nbsp;</p>\r\n                    <p>When you participate as a Driver through the Driver Services, we may also collect and\r\n                        store information related to your Orders and deliveries, including:</p>\r\n                    <ul>\r\n                        <li>Date and time of the sign-up and log-in;</li>\r\n                        <li>Delivery acceptances and declinations and your acceptance rate and cancellation\r\n                            rate;</li>\r\n                        <li>The number of Orders and deliveries you make;</li>\r\n                        <li>The date and time of delivery acceptances, declinations, cancellations, pick-ups and\r\n                            completions;</li>\r\n                        <li>The amount of time to complete a delivery or Order;</li>\r\n                        <li>Order and delivery route information;</li>\r\n                        <li>Payment amounts associated with each delivery and Order;</li>\r\n                        <li>Tip amounts;</li>\r\n                        <li>Customer ratings and other feedback;&nbsp;</li>\r\n                        <li>Attribution and users conversion path;</li>\r\n                        <li>Your location (see Location Information section, above).</li>\r\n                    </ul>\r\n                    <p>&nbsp;</p>\r\n                    <p><i><u>1f. Personal Information from Publicly-Available Sources and Third Parties</u></i>\r\n                    </p>\r\n                    <p>&nbsp;</p>\r\n                    <p>We may collect Personal Information about you from publicly-available sources, marketing\r\n                        partners, and/or third parties. This may include demographic information such as income\r\n                        and spending habits. We may also, for example, receive information about you from\r\n                        Merchants regarding your deliveries through the Driver Services.&nbsp;</p>\r\n                    <p>&nbsp;</p>\r\n                    <p>MyAce may also offer a Driver Referral Program where MyAce allows Drivers to invite\r\n                        friends and family to sign up for the Driver Services and become a Driver. We may offer\r\n                        referral bonuses, as set forth in any referral terms governing the Driver Referral\r\n                        Program. To help you do this, we may request that you grant us access to your mobile\r\n                        device address book. You can then direct us to send referral emails or other\r\n                        communications to contacts you select in your address book. By sending a referral, you\r\n                        also consent to MyAce sending your public profile image to the contacts you select to\r\n                        receive a referral link. By choosing to invite a friend, you represent that you have\r\n                        received the friends consent to provide his or her name and email address with us.\r\n                        MyAce will use that information to send an email inviting him or her to visit the\r\n                        site and will store that information to track the success of the referral program and\r\n                        may send marketing emails. You can also send an SMS with a referral link to your\r\n                        contacts.</p>\r\n                    <p>&nbsp;</p>\r\n                    <p>Drivers may not send, publish, or share any false, misleading, or deceptive\r\n                        communications in connection with participation in the Referral Program. Such actions\r\n                        may violate applicable laws. MyAce users may not send any referral emails, SMS\r\n                        messages, or other communications to children under the age of 18.</p>\r\n                    <p>&nbsp;</p>\r\n                    <p>If you are referred to MyAce through one of our referral programs, or if someone\r\n                        attempts to refer you, we may share your name, whether you have already signed up as a\r\n                        Driver, whether you are a new Driver, and whether you have completed the required number\r\n                        of deliveries in the required amount of time to qualify for a referral bonus.</p>\r\n                    <p><br></p>\r\n                    <p><b>2. Use of Cookies and Other Tracking Technologies&nbsp;</b></p>\r\n                    <p>&nbsp;</p>\r\n                    <p>We use cookies, web beacons, pixels, replay session, and similar technologies to collect\r\n                        information and personalize your experience with the Driver Services.</p>\r\n                    <p>&nbsp;</p>\r\n                    <p><i><u>2a. Cookies</u></i></p>\r\n                    <p>&nbsp;</p>\r\n                    <p>Cookies are small web files that a site or its provider transfers to your devices hard\r\n                        drive through your web browser that enables the sites or providers system to recognize\r\n                        your browser and remember certain information.</p>\r\n                    <p>&nbsp;</p>\r\n                    <p>We use first-party and third-party cookies for the following purposes: (1) to make the\r\n                        Driver Services function properly; (2) to improve the Driver Services; (3) to recognize\r\n                        you when you return to our Site and to remember information you have already provided,\r\n                        such as your preferences; (4) to collect information about your activities over time and\r\n                        across third party websites or other online services in order to deliver content and\r\n                        advertising tailored to your interests; and (5) to provide a secure browsing experience\r\n                        during your use of the Driver Services.</p>\r\n                    <p>&nbsp;</p>\r\n                    <p>You may disable the use of cookies by modifying your browser settings. If you choose to\r\n                        disable cookies you may not be able to fully experience the interactive features of the\r\n                        Driver Services. For more information on cookies and how to disable cookies visit <a\r\n                            target=\"_blank\"\r\n                            href=\"http://www.ftc.gov/ftc/cookies.shtm\"><u>www.ftc.gov/ftc/cookies.shtm</u></a>\r\n                        or <a target=\"_blank\"\r\n                            href=\"https://www.usa.gov/optout_instructions.shtml\"><u>https://www.usa.gov/optout_instructions.shtml</u></a>.&nbsp;\r\n                    </p>\r\n                    <p>&nbsp;</p>\r\n                    <p><i><u>2b. Web Beacons</u></i></p>\r\n                    <p>&nbsp;</p>\r\n                    <p>Web beacons, also known as web bugs, pixel tags or clear GIFs, are tiny graphics with a\r\n                        unique identifier that may be included on our Site to deliver or communicate with\r\n                        cookies, in order to track and measure the performance of our Site and services, monitor\r\n                        how many web visitors we have, and to monitor the effectiveness of our advertising.\r\n                        Unlike cookies, which are stored on the users hard drive, web beacons are typically\r\n                        embedded invisibly on webpages (or in an email).</p>\r\n                    <p>&nbsp;</p>\r\n                    <p><i><u>2c. Replay Session</u></i></p>\r\n                    <p>&nbsp;</p>\r\n                    <p>We may collect information on your use of our Site or the Driver Services, such as pages\r\n                        visited, links clicked, non-sensitive text entered, and mouse and scrolling movements.\r\n                        The information collected may include a recreation of your session interactions on our\r\n                        Site. We take measures to utilize replay session technology to exclude and block\r\n                        sensitive user information.&nbsp;</p>\r\n                    <p><br></p>\r\n                    <p><i><u>2d. Online Analytics and Advertising Technologies</u></i></p>\r\n                    <p>&nbsp;</p>\r\n                    <p>We and our third-party vendors may use automated technologies (including cookie\r\n                        identifiers on our Site), along with other collected information, to tailor ads or\r\n                        deliver content when you are on the Driver Services or on other devices, apps or\r\n                        websites.</p>\r\n                    <p>&nbsp;</p>\r\n                    <p><i><u>2e. Targeted Advertising</u></i></p>\r\n                    <p>&nbsp;</p>\r\n                    <p>We (or our service providers) may use the information we collect, for instance, IP\r\n                        addresses and unique mobile device identifiers, to locate or try to locate the same\r\n                        unique users across multiple browsers or devices (such as smartphones, tablets, or\r\n                        computers), or work with providers that do this, in order to better tailor content and\r\n                        features and provide you with a seamless experience across devices. If you wish to opt\r\n                        out of such cross device tracking for purposes of interest-based advertising, you may do\r\n                        so through your device settings. We may also use cross-device tracking to help identify\r\n                        our users and serve advertising. This type of advertising is often called\r\n                        interest-based or personalized advertisingand when it occurs on mobile apps,\r\n                        cross-app advertising.</p>\r\n                    <p>&nbsp;</p>\r\n                    <p>You can learn more about interest-based advertising and how to opt-out of receiving\r\n                        tailored advertising by visiting (i) the Network Advertising Initiatives Consumer <a\r\n                            target=\"_blank\" href=\"http://www.networkadvertising.org/choices\"><u>Opt-Out\r\n                                link</u></a> or (ii) the Digital Advertising Alliances Consumer <a target=\"_blank\"\r\n                            href=\"http://www.aboutads.info/choices/\"><u>Opt-Out link</u></a>. To\r\n                        opt out of Google Analytics for display advertising or customize Google display network\r\n                        ads, you can visit the <a target=\"_blank\" href=\"https://www.google.com/settings/ads\"><u>Google\r\n                                Ads Settings page</u></a>.\r\n                        California users can also opt-out of receiving interest-based advertising based on your\r\n                        browser by opting out using the Do Not Sell link on the <a rel=\"noopener\" target=\"_blank\"\r\n                            href=\"https://MyAce.com\">MyAce.com</a> homepage. That opt-out\r\n                        is only effective on the browser level and on <a rel=\"noopener\" target=\"_blank\"\r\n                            href=\"https://www.MyAce.com\">www.MyAce.com</a>.&nbsp; If you clear your\r\n                        cookies on this browser or use a different browser, you will need to renew your\r\n                        request.&nbsp;</p>\r\n                    <p>&nbsp;</p>\r\n                    <p>Please note that even if you opt-out, you may still receive advertisements from us.\r\n                        However, in that case, the advertising will not be tailored to your interests. Also, we\r\n                        do not control any of the above opt-out links or whether any particular company chooses\r\n                        to participate in these opt-out programs.</p>\r\n                    <p>&nbsp;</p>\r\n                    <p><i><u>2f. Mobile Applications</u></i></p>\r\n                    <p>&nbsp;</p>\r\n                    <p>Depending on your permissions, we may receive your Personal Information from your\r\n                        Internet service and mobile device providers. Users of mobile devices who do not want to\r\n                        receive interest-based advertising may opt-out in several ways. Learn more about your\r\n                        choices for mobile devices by visiting <a target=\"_blank\"\r\n                            href=\"http://www.aboutads.info/appchoices\"><u>http://www.aboutads.info/appchoices</u></a>.\r\n                        Each operating system, (iOS for Apple phones, Android for Android devices, and Windows\r\n                        for Microsoft devices) provides its own instructions on how to prevent the delivery of\r\n                        in-application targeted advertisements. You should view your device or system Settings\r\n                        to determine how you can opt out of use of your device ID for cross-app personalized\r\n                        advertising.</p>\r\n                    <p>&nbsp;</p>\r\n                    <p><b>3. Uses of Your Personal Information</b></p>\r\n                    <p>&nbsp;</p>\r\n                    <p>We may use the information we collect about you for various purposes.</p>\r\n                    <p>&nbsp;</p>\r\n                    <p><i><u>3a. To Create Your Driver Account</u></i></p>\r\n                    <p>&nbsp;</p>\r\n                    <p>We may process your information when you sign up to be a Driver, including background and\r\n                        driving history checks. As part of the process, we may assess whether you qualify to be\r\n                        a Driver and allow you to create a Driver account.</p>\r\n                    <p><br></p>\r\n                    <p><i><u>3b. To Provide You With the Driver Services</u></i></p>\r\n                    <p>&nbsp;</p>\r\n                    <p>We may use your information to provide you the Driver Services. For example, we use\r\n                        information to:</p>\r\n                    <ul>\r\n                        <li>set up your direct deposit and issue payments to you;</li>\r\n                        <li>allow you to connect to delivery requests;&nbsp;</li>\r\n                        <li>facilitate the completion of Orders and deliveries;</li>\r\n                        <li>calculate payments owed;</li>\r\n                        <li>verify whether you are present in the city or region in which you intend to provide\r\n                            services;\r\n                        </li>\r\n                        <li>assess whether you have met requirements for promotional, incentive or other pay\r\n                            programs;</li>\r\n                        <li>assess supply, demand, and other factors associated with aggregate business\r\n                            progress;</li>\r\n                        <li>assess activity and acceptance rates, customer ratings, and other factors associated\r\n                            with Drivers impact on the MyAce platform; and</li>\r\n                        <li>link your Driver account to your MyAce account, if you already have a MyAce\r\n                            account or if you create one in the future.</li>\r\n                    </ul>\r\n                    <p>&nbsp;</p>\r\n                    <p><i><u>3c. To Maintain, Improve, and Personalize the Driver Services</u></i></p>\r\n                    <p>&nbsp;</p>\r\n                    <p>We may use your information for our everyday business operations such as auditing,\r\n                        administration of the Driver Services, forum management, fulfillment, and analytics. For\r\n                        example, we may use your information to better understand Drivers demographics,\r\n                        interests and behaviors, and we may enhance other information we have about you to help\r\n                        us better understand you and determine your interests. We may also use your information\r\n                        to calculate the total number of visitors to the Driver Services and to each page or\r\n                        feature of the Driver Services. Your information may also be used to improve the content\r\n                        and functionality of the Driver Services. For example, it may be used to help us, and\r\n                        our Merchants improve our offerings. We also use your information to personalize your\r\n                        experience. For example, we may personalize the content and features you see when\r\n                        visiting the Driver Services. In addition, we may personalize advertisements, marketing\r\n                        communications, and recommendations to make them more tailored to your interests.</p>\r\n                    <p>&nbsp;</p>\r\n                    <p><i><u>3d. To Communicate with You</u></i></p>\r\n                    <p>&nbsp;</p>\r\n                    <p>We use your information to communicate with you. For example, we may send you text\r\n                        messages or other notifications about the status of your orders and deliveries. We may\r\n                        also contact you with promotional offerings or other communications that may be of\r\n                        interest to you. If we send you marketing emails or texts about services that may\r\n                        interest you, each email or text will contain instructions permitting you to opt-out\r\n                        of receiving future email or text marketing communications.</p>\r\n                    <p>&nbsp;</p>\r\n                    <p>In the event you contact us, we use certain information to respond to your questions and\r\n                        assist you with any issues that may arise in your use of the Driver Services. Any\r\n                        communication or material you transmit to us via e-mail or otherwise, including any\r\n                        data, questions, comments, suggestions or the like, but not including your Personal\r\n                        Information and any requests, comments or concerns regarding your personal information\r\n                        but not including your Personal Information, will be treated as non-confidential and\r\n                        non-proprietary.</p>\r\n                    <p>&nbsp;</p>\r\n                    <p>If you send direct messages, such as chat or text messages to a MyAce customer, using\r\n                        the telephone number for that customer available on the Driver Services, we may use a\r\n                        third-party service provider to monitor and analyze these messages. We monitor these\r\n                        messages for fraud prevention, to ensure appropriate charging of fees, to enforce our\r\n                        Terms and Conditions, and for quality and training purposes. As part of this process,\r\n                        MyAce and its service provider will receive in real time and store data about your\r\n                        direct messages, such as chat or text messages, including the date and time of the\r\n                        message, your phone number, and the content of the message. If you do not agree to the\r\n                        monitoring of direct messages you send to MyAce customers, please do not send\r\n                        messages to MyAce customers.</p>\r\n                    <p><br></p>\r\n                    <p><i><u>3e. For Account and Network Security Purposes</u></i></p>\r\n                    <p>&nbsp;</p>\r\n                    <p>We care about keeping you secure and safe while using the Driver Services. Keeping you\r\n                        safe requires us to process your Personal Information, such as your device information,\r\n                        activity information and other relevant information. We use such information to combat\r\n                        spam, malware, malicious activities or security risks; improve and enforce our security\r\n                        measures; and to monitor and verify your identity to prevent unauthorized users from\r\n                        gaining access to your information.</p>\r\n                    <p>&nbsp;</p>\r\n                    <p><i><u>3f. To Maintain Legal and Regulatory Compliance</u></i></p>\r\n                    <p>&nbsp;</p>\r\n                    <p>The Driver Services are subject to certain laws and regulations which may require us to\r\n                        process your Personal Information. For example, we may process your Personal Information\r\n                        to provide you with tax documents, to fulfill our business obligations, or as necessary\r\n                        to manage risk as required under applicable law.&nbsp;</p>\r\n                    <p>&nbsp;</p>\r\n                    <p><i><u>3g. To Enforce Compliance with our Independent Contractor Agreement and\r\n                                Policies</u></i></p>\r\n                    <p>&nbsp;</p>\r\n                    <p>When you access or use the Driver Services, you are bound to our Independent\r\n                        Contractor Agreement and this Policy. To ensure you comply with them, we\r\n                        process your Personal Information by actively monitoring, investigating, preventing, and\r\n                        mitigating any alleged or actual prohibited, illicit or illegal activities on the Driver\r\n                        Services. We also process your Personal Information to: investigate, prevent or mitigate\r\n                        violations of our internal terms, agreements or policies; enforce our agreements with\r\n                        third parties and business partners.</p>\r\n                    <p>&nbsp;</p>\r\n                    <p><i><u>3h. To Protect You, Others, and Our Business</u></i></p>\r\n                    <p>&nbsp;</p>\r\n                    <p>We use your information to protect you, others, and our business, including, without\r\n                        limitation, using information for fraud prevention, for enforcement of our Independent\r\n                        Contractor Agreement, to comply with the law, and to protect against\r\n                        security risks.</p>\r\n                    <p>&nbsp;</p>\r\n                    <p><i><u>3i. For Our Business Purposes</u></i></p>\r\n                    <p>&nbsp;</p>\r\n                    <p>We may use your information for any other purpose disclosed to you at the time we collect\r\n                        the information, or otherwise with your consent or at your direction.</p>\r\n                    <p>&nbsp;</p>\r\n                    <p><i><u>3j. Aggregated and De-Identified Information</u></i></p>\r\n                    <p>&nbsp;</p>\r\n                    <p>We may aggregate and/or de-identify information collected through the Driver Services. We\r\n                        may use de-identified or aggregated data for any purpose, including without limitation\r\n                        for research and marketing purposes and may also share such data with any third parties,\r\n                        including without limitation, advertisers, promotional partners, sponsors, event\r\n                        promoters, and/or others.</p>\r\n                    <p><br></p>\r\n                    <p><b>4. Providing of Personal Information to Third Parties</b></p>\r\n                    <p>&nbsp;</p>\r\n                    <p>We may provide your information to third parties as described below.</p>\r\n                    <p>&nbsp;</p>\r\n                    <p><i><u>4a. Group Companies</u></i></p>\r\n                    <p>&nbsp;</p>\r\n                    <p>We may provide your information to our group companies (entities that control or are\r\n                        under the control of MyAce) for business purposes. We will require these entities to\r\n                        comply with the terms of this Policy with regard to their use of your information.</p>\r\n                    <p>&nbsp;</p>\r\n                    <p><i><u>4b. Service Providers</u></i></p>\r\n                    <p>&nbsp;</p>\r\n                    <p>We may provide your information to our third-party service providers for certain business\r\n                        purposes. This information is provided in order for them to provide us services such as\r\n                        payment processing, advertising services, marketing partners, background and driver\r\n                        history check services, web analytics, data processing, IT services, Driver support and\r\n                        other services.&nbsp;</p>\r\n                    <p>&nbsp;</p>\r\n                    <p><i><u>4c. Customers, Merchants, or other users</u></i></p>\r\n                    <p>&nbsp;</p>\r\n                    <p>To facilitate deliveries, we may provide your information, including your contact\r\n                        information, vehicle information, location information, ratings, and other information\r\n                        to customers, Merchants or other MyAce users.&nbsp;</p>\r\n                    <p>&nbsp;</p>\r\n                    <p><i><u>4d. Social Media</u></i></p>\r\n                    <p>&nbsp;</p>\r\n                    <p>When you link a Social Network account to MyAce or log into our Services using your\r\n                        Social Network account, we may provide your information to the operator of the Social\r\n                        Network to facilitate or enhance delivery of that Social Network or other services to\r\n                        you. Please see 8.&nbsp; Social Media Usage below for more details.</p>\r\n                    <p>&nbsp;</p>\r\n                    <p><i><u>4e. When Required by Law</u></i></p>\r\n                    <p>&nbsp;</p>\r\n                    <p>We recognize that information related to your activities as a Driver could contain\r\n                        private information. However, we may be required to provide your information to third\r\n                        parties including law enforcement agencies when required to protect and defend our legal\r\n                        rights, protect the safety and security of MyAce users, prevent fraud, comply with\r\n                        the law, respond to legal process, or a request for cooperation by a government entity\r\n                        and the like. We have developed a process that strikes a balance between protecting\r\n                        customer privacy and responding to valid law enforcement requests.&nbsp;\r\n                    </p>\r\n                    <p>&nbsp;</p>\r\n                    <p><i><u>4f. Corporate Transactions</u></i></p>\r\n                    <p>&nbsp;</p>\r\n                    <p>In the event of an actual or contemplated sale, business transfer, merger,\r\n                        reorganization, dissolution, or similar event we may transfer your information to one or\r\n                        more third parties as part of that transaction, including during the negotiation of a\r\n                        transaction.</p>\r\n                    <p>&nbsp;</p>\r\n                    <p><i><u>4g. With Your Consent</u></i></p>\r\n                    <p>&nbsp;</p>\r\n                    <p>We also may provide your information to third parties with your consent or at your\r\n                        direction.</p>\r\n                    <p><br></p>\r\n                    <p><b>5. Security</b></p>\r\n                    <p>&nbsp;</p>\r\n                    <p>MyAce has implemented administrative, organizational, technical, and physical security\r\n                        controls that are designed to safeguard Personal Information. However, no online\r\n                        activity is ever fully secure or error-free. While we strive to protect your\r\n                        information, we cannot guarantee that your Personal Information is absolutely secure.\r\n                        Please keep this in mind when disclosing any information to MyAce.&nbsp;</p>\r\n                    <p>&nbsp;</p>\r\n                    <p>Please recognize that protecting your Personal Information is also your responsibility.\r\n                        We urge you to take every precaution to protect your information when you are on the\r\n                        Internet, or when you communicate with us and with others through the Internet. Change\r\n                        your passwords often, use a combination of letters and numbers, and make sure you use a\r\n                        secure browser. If you have reason to believe that your interaction with us is no longer\r\n                        secure (for example, if you feel that the security of your account might have been\r\n                        compromised), or if you suspect someone else is using your account, please let us know\r\n                        immediately by contacting us as indicated in the Contact Us section below.</p>\r\n                    <p>&nbsp;</p>\r\n                    <p><b>6. Data Retention</b></p>\r\n                    <p>&nbsp;</p>\r\n                    <p>We will retain your Personal Information for as long as your account is active or as\r\n                        needed to provide you services and to maintain a record of your transactions for\r\n                        financial reporting purposes. We will also retain and use your personal information as\r\n                        necessary to comply with our legal obligations, resolve disputes, and enforce our\r\n                        agreements. We may retain aggregate or anonymized data indefinitely.</p>\r\n                    <p>&nbsp;</p>\r\n                    <p><b>7. Third-Party Sites</b></p>\r\n                    <p>&nbsp;</p>\r\n                    <p>Some of the functionality may be provided by third parties and the Driver Services may\r\n                        link to other third-party websites that are not controlled by MyAce. For example, we\r\n                        use services like Stripe for payment processing. These third parties are not under our\r\n                        control and MyAce is not responsible for their privacy policies or practices. If you\r\n                        provide any personal information to any third party or through any such third-party\r\n                        website, we recommend that you familiarize yourself with the privacy policies and\r\n                        practices of that third party.</p>\r\n                    <p>&nbsp;</p>\r\n                    <p><b>8. Social Media Usage</b></p>\r\n                    <p>&nbsp;</p>\r\n                    <p>The Driver Services may enable you to access social networking services such as Facebook,\r\n                        Twitter, or Instagram, among others (collectively, \"Social Network\") directly or\r\n                        indirectly through the Driver Services. You may also have the option of posting content\r\n                        to a Social Network when you access content through the Driver Services. For example,\r\n                        you may refer a friend to become a Driver via Twitter or Facebook links through the\r\n                        Driver Services. Keep in mind that your activity on a Social Network is governed by that\r\n                        Social Network and not by MyAce and may be visible or accessible to the public. We\r\n                        may also provide the ability to enable or log in to the MyAce app and <a target=\"_blank\"\r\n                            href=\"http://www.MyAce.com/\"><u>www.MyAce.com</u></a> via a\r\n                        Social Network, as described in more detail in our MyAce Privacy Policy. Your Driver\r\n                        account and information collected through the Driver Services may, at times, be linked\r\n                        to your MyAce customer accounts and any affiliated Social Networks you have enabled\r\n                        via MyAce.</p>\r\n                    <p><br></p>\r\n                    <p><b>9. Childrens Information</b></p>\r\n                    <p>&nbsp;</p>\r\n                    <p>The Driver Services are not intended for children under 18 years of age and we do not\r\n                        knowingly collect personal information from children under the age of 13 through the\r\n                        Driver Services. If you are a parent or guardian of a child under the age of 13 and\r\n                        believe he or she has disclosed personally identifiable information to us, please\r\n                        contact us at <u><a href=\"mailto:privacy@MyAce.com\">privacy@MyAce.com</a></u>. A\r\n                        parent or guardian of a child under age 13 may review and request deletion of the\r\n                        childs personal information.</p>\r\n                    <p>&nbsp;</p>\r\n                    <p><b>10. Accessing and Correcting Your Personal Information, and Your Choices</b></p>\r\n                    <p>&nbsp;</p>\r\n                    <p>Keeping your personal information current helps ensure that we provide you with the most\r\n                        relevant services. You can access and update your personal information via your account\r\n                        profile. While we are ready to assist you in managing your registrations, deactivating\r\n                        your account, and removing your active profile and data, we cannot always delete records\r\n                        of past interactions and transactions. For example, we are required to retain records\r\n                        relating to payments issued to you for financial reporting and compliance reasons. In\r\n                        addition, because of the way we maintain certain services, after you delete certain\r\n                        information, we may temporarily retain backup copies of such information before it is\r\n                        permanently deleted.</p>\r\n                    <p>&nbsp;</p>\r\n                    <p>If you are a registered Driver, you may access and modify your personal information by\r\n                        logging into the Driver site using your username and password and visiting the Account\r\n                        page. You may disable our ability to use cookies by using the cookie controls in your\r\n                        web browser (see Use of Cookies and Other Tracking Technologies section above).</p>\r\n                    <p>&nbsp;</p>\r\n                    <p>If we send you marketing emails about services that may interest you, each email will\r\n                        contain instructions permitting you to opt-out of receiving email marketing\r\n                        communications.</p>\r\n                    <p>&nbsp;</p>\r\n                    <p>You may also contact us at <u><a href=\"mailto:privacy@MyAce.com\">privacy@MyAce.com</a></u> to\r\n                        access,\r\n                        modify or request deletion of your personal information.</p>\r\n                    <p>&nbsp;</p>\r\n                    <p><b>11. Your California Privacy Rights</b></p>\r\n                    <p>&nbsp;</p>\r\n                    <p>Pursuant to Section 1798.83 of the California Civil Code, residents of California can\r\n                        obtain certain information about the types of personal information that companies with\r\n                        whom they have an established business relationship have shared with third parties for\r\n                        their direct marketing purposes during the preceding calendar year. In particular, the\r\n                        law provides that companies must inform consumers about the categories of personal\r\n                        information that have been shared with third parties, the names and addresses of those\r\n                        third parties, and examples of the types of services or products marketed by those third\r\n                        parties. To request a copy of the information disclosure provided by MyAce pursuant\r\n                        to Section 1798.83 of the California Civil Code, please contact us via the email or\r\n                        mailing address provided below. Please allow 30 days for a response.</p>\r\n                    <p><br></p>\r\n                    <p><b>12. California Do Not Track Disclosure</b></p>\r\n                    <p>&nbsp;</p>\r\n                    <p>MyAce does not have a mechanism in place for responding to browser do not track\r\n                        signals or other similar mechanisms used to limit collection of information for use in\r\n                        Online Behavioral Advertising.</p>\r\n                    <p>&nbsp;</p>\r\n                    <p><b>13. International Users</b></p>\r\n                    <p>&nbsp;</p>\r\n                    <p>MyAce is based in the United States and, regardless of where you use the Driver\r\n                        Services, the information collected as part of that use will be transferred to and\r\n                        maintained on servers located in the United States. By using the Driver Services, you\r\n                        consent to this collection, transfer, storage, and processing of information to and in\r\n                        the United States.</p>\r\n                    <p>&nbsp;</p>\r\n                    <p><b>14. Contact Us</b></p>\r\n                    <p>&nbsp;</p>\r\n                    <p>If you have any questions or concerns relating to this Policy or our privacy practices,\r\n                        please contact us at: <u><a href=\"mailto:privacy@MyAce.com\">privacy@MyAce.com</a></u>&nbsp;\r\n                    </p>\r\n                    <p>&nbsp;</p>\r\n                    <p>MyAce, Inc.</p>\r\n                </span></lightning-formatted-rich-text>\r\n        </p>\r\n    </div>', '2022-10-04 16:12:43', '2022-12-13 07:03:16'),
